import { getWeather } from "../services/connection"

const Detailed = ({ country }) => {

    const weather2 = getWeather(country.latlng[0], country.latlng[1])



    const [weather, setWeather] = useState(
        getWeather(country.latlng[0], country.latlng[1]).then(response => {
            setWeather(response.data)
        })
    )





    return (
        <div>
            <h1>{country.name.common}</h1>
            <p>capital {country.capital}</p>
            <p>area {country.area}</p>
            <h2>Languages:</h2>
            {Object.values(country.languages).map((lan) => <li>{lan}</li>)}
            <img src={country.flags.png}></img>
        </div>
    )
}

export default Detailed
